<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Dating App ‚Äì Full Firebase HTML</title>

<!-- Firebase -->
<script src="https://www.gstatic.com/firebasejs/9.23.0/firebase-app-compat.js"></script>
<script src="https://www.gstatic.com/firebasejs/9.23.0/firebase-auth-compat.js"></script>
<script src="https://www.gstatic.com/firebasejs/9.23.0/firebase-database-compat.js"></script>
<script src="https://www.gstatic.com/firebasejs/9.23.0/firebase-storage-compat.js"></script>

<style>
*{box-sizing:border-box;font-family:Arial}
body{margin:0;background:#f2f3f7}
header{background:#ff4d6d;color:#fff;padding:12px;display:flex;justify-content:space-between;align-items:center}
.container{max-width:420px;margin:auto;padding:10px}
.card{background:#fff;border-radius:15px;box-shadow:0 8px 20px rgba(0,0,0,.1);margin-bottom:15px}
input,select{width:100%;padding:10px;margin-bottom:8px;border-radius:8px;border:1px solid #ccc}
button{border:none;padding:10px;border-radius:10px;cursor:pointer}
.btn{background:#ff4d6d;color:#fff;width:100%}

/* Swipe Cards */
.profile-card img{width:100%;height:300px;object-fit:cover;border-radius:15px 15px 0 0}
.profile-info{padding:10px}
.actions{display:flex;gap:8px}
.like{background:#4caf50;color:#fff;flex:1}
.pass{background:#ccc;flex:1}
.chat{background:#2196f3;color:#fff;flex:1}

/* User List */
.user{display:flex;align-items:center;padding:8px;border-bottom:1px solid #eee;cursor:pointer}
.user img{width:40px;height:40px;border-radius:50%;margin-right:10px}
.online{color:green;font-size:12px}

/* Chat */
.chat-popup{position:fixed;bottom:0;left:0;right:0;background:#fff;max-width:420px;margin:auto;border-radius:20px 20px 0 0;display:none}
.chat-header{background:#ff4d6d;color:#fff;padding:10px;display:flex;justify-content:space-between}
.messages{height:220px;overflow:auto;padding:10px}
.msg{margin-bottom:6px}
.me{text-align:right;color:#ff4d6d}

/* Proposal */
.proposal{background:#fff;padding:10px;border-radius:10px;margin-bottom:10px}

footer{text-align:center;color:#777;padding:10px}
</style>
</head>
<body>

<header>
<h3>‚ù§Ô∏è Dating App</h3>
<div>üîî ‚öôÔ∏è</div>
</header>

<div class="container">

<!-- LOGIN -->
<div id="loginBox" class="card">
<h3>Create Profile</h3>
<input id="name" placeholder="Name">
<input id="age" type="number" placeholder="Age">
<select id="gender"><option>Male</option><option>Female</option></select>
<input type="file" id="img">
<button class="btn" onclick="login()">Start</button>
</div>

<!-- SWIPE -->
<div id="swipe" style="display:none" class="card profile-card">
<img id="simg" src="https://picsum.photos/400/600">
<div class="profile-info">
<h3 id="sname">User</h3>
<p id="sstatus" class="online">‚óè Online</p>
<div class="actions">
<button class="pass" onclick="nextUser()">‚ùå</button>
<button class="like" onclick="sendProposal()">‚ù§Ô∏è</button>
<button class="chat" onclick="openChat()">üí¨</button>
</div>
</div>
</div>

<!-- USERS -->
<div id="users" class="card" style="display:none">
<h3 style="padding:10px">Chats</h3>
<div id="userList"></div>
</div>

<!-- PROPOSALS -->
<div id="proposals" class="card" style="display:none">
<h3 style="padding:10px">Proposals</h3>
<div id="proposalList"></div>
</div>

</div>

<!-- CHAT POPUP -->
<div class="chat-popup" id="chatPopup">
<div class="chat-header">
<span id="chatWith">Chat</span>
<span onclick="closeChat()">‚úñ</span>
</div>
<div class="messages" id="messages"></div>
<div style="display:flex;padding:10px;gap:5px">
<input id="msgInput" placeholder="Message">
<button onclick="sendMsg()">Send</button>
</div>
</div>

<footer>HTML + Firebase Realtime Dating App</footer>

<script>
/* Firebase */
const firebaseConfig={apiKey:"AIzaSyAlWP5D79PsX29H0hIZlfvL0YV5Us7v5I4",authDomain:"sample-firebase-ai-app-1f408.firebaseapp.com",databaseURL:"https://sample-firebase-ai-app-1f408-default-rtdb.asia-southeast1.firebasedatabase.app",projectId:"sample-firebase-ai-app-1f408",storageBucket:"sample-firebase-ai-app-1f408.firebasestorage.app",messagingSenderId:"657942233322",appId:"1:657942233322:web:a8dd9896ca8cfccdbb5793"};
firebase.initializeApp(firebaseConfig);
const auth=firebase.auth();
const db=firebase.database();
const storage=firebase.storage();

let currentUser,users=[],index=0,chatUser;

/* Login */
function login(){auth.signInAnonymously();}

auth.onAuthStateChanged(u=>{
 if(!u)return;
 currentUser=u.uid;
 loginBox.style.display='none';
 swipe.style.display='block';
 usersDiv();
 saveProfile();
});

function saveProfile(){
 const file=img.files[0];
 const ref=storage.ref('profiles/'+currentUser);
 ref.put(file).then(()=>ref.getDownloadURL()).then(url=>{
  db.ref('users/'+currentUser).set({
   name:name.value,age:age.value,gender:gender.value,img:url,status:'online'
  });
 });
}

/* Load users */
function usersDiv(){
 db.ref('users').on('value',s=>{
  users=[];
  s.forEach(c=>{if(c.key!==currentUser)users.push({id:c.key,...c.val()})});
  showSwipe();
  showUserList();
 });
}

function showSwipe(){
 if(!users.length)return;
 const u=users[index%users.length];
 simg.src=u.img; sname.innerText=u.name+', '+u.age;
}

function nextUser(){index++;showSwipe();}

/* Proposal */
function sendProposal(){
 const to=users[index%users.length].id;
 db.ref('proposals/'+to+'/'+currentUser).set({from:currentUser,status:'pending'});
 alert('Proposal sent ‚ù§Ô∏è'); nextUser();
}

/* Proposal accept/reject */
db.ref('proposals/'+currentUser).on('value',s=>{
 proposalList.innerHTML='';
 s.forEach(c=>{
  const div=document.createElement('div');div.className='proposal';
  div.innerHTML=`<p>${c.key} sent proposal</p>
  <button onclick="accept('${c.key}')">Accept</button>
  <button onclick="reject('${c.key}')">Reject</button>`;
  proposalList.appendChild(div);
 });
});

function accept(id){db.ref('matches/'+currentUser+'/'+id).set(true);}
function reject(id){db.ref('proposals/'+currentUser+'/'+id).remove();}

/* User list */
function showUserList(){
 userList.innerHTML='';
 users.forEach(u=>{
  const d=document.createElement('div');d.className='user';
  d.innerHTML=`<img src="${u.img}"><div>${u.name}<br><span class="online">‚óè ${u.status}</span></div>`;
  d.onclick=()=>openChat(u);
  userList.appendChild(d);
